INSERT INTO `question` (`questionID`, `question`, `Description`) VALUES
(1, 'สถานะ', 'สถานะปัจจุบันของการดำเนินโครงการ'),
(2, 'ความก้าวหน้าโครงการ', 'ร้อยละของความก้าวหน้าภาพรวมในการดำเนินโครงการ'),
(3, 'แนบรูปภาพ', 'แนบภาพประกอบการดำเนินโครงการเพื่อเป็นหลักฐานแสดงความสำเร็จของโครงการ'),
(4, 'ผลการดำเนินงาน', 'ระบุผลสำเร็จหรือผลประโยชน์ที่เกิดขึ้นจากการดำเนินโครงการ'),
(5, 'ประเภทปัญหา', 'ระบุผลสำเร็จหรือผลประโยชน์ที่เกิดขึ้นจากการดำเนินโครงการ'),
(6, 'ปัญหาอื่นๆ', 'ระบุปัญหาที่พบจากการดำเนินโครงการ นอกเหนือจากที่กำหนดไว้'),
(7, 'ผลลัพธ์', 'ผลที่เกิดขึ้นต่อยอดจากผลผลิต หรือผลระยะยาวซึ่งเกิดเป็นผลจุดหมายปลายทาง หรือผลต่อเนื่องจากผลกระทบ'),
(8, 'ปัญหา/อุปสรรค', 'อธิบายรายละเอียดของปัญหาที่พบจากการดำเนินโครงการ'),
(9, 'แนวทางแก้ไข', 'ระบุวิธีการแก้ไขปัญหาที่พบจากการดำเนินโครงการ'),
(10, 'หมายเหตุ', 'ผลการดำเนินการอื่นๆที่ต้องการรายงาน'),
(11, 'รูปแบบการลงทุน', 'เลือกรูปแบบการลงทุนแบบใด'),
(12, 'งบประมาณที่ใช้ในการดำเนินการ', 'ระบุงบประมาณที่เกิดขึ้นจากการดำเนินโครงการ'),
(20, 'คำถามเพิ่มเติม1', 'รายละเอียด'),
(25, 'asdfasd', 'asdfasdfasf');
